// ==UserScript==
// @name         小说页面伪装|小说页面精简|起点页面伪装|番茄页面伪装|笔趣阁页面伪装|书香小说页面伪装
// @namespace    https://github.com/NiaoBlush/novel-disguise
// @version      1.4.1
// @description  将小说页面伪装成一个word文档，同时净化小说页面，去除不必要的元素。适用于起点小说、番茄小说、部分笔趣阁、书香小说
// @author       NiaoBlush
// @license      MIT
// @homepageURL  https://github.com/NiaoBlush/novel-disguise
// @supportURL   https://github.com/NiaoBlush/novel-disguise/issues
// @icon64       https://s21.ax1x.com/2024/08/06/pkxPf0S.png
// @match        https://www.qidian.com/chapter/*
// @match        https://fanqienovel.com/reader/*
// @match        *://www.biquge.net/*/*/*.html
// @match        *://www.xbiqugu.net/*/*/*.html
// @match        *://www.biquge.co/*/*.html
// @match        *://www.52wx.com/*/*.html
// @match        https://www.3bqg.cc/book/*/*.html
// @match        https://www.bigee.cc/book/*/*.html
// @match        https://www.beqege.cc/*/*.html
// @match        https://www.biqukun.com/*/*/*.html
// @match        https://www.biquge.tw/book/*/*.html
// @match        https://weread.qq.com/web/reader/*
// @require      https://libs.baidu.com/jquery/2.0.3/jquery.min.js
// @grant        GM_addStyle
// ==/UserScript==


(function () {
    'use strict';
    console.log("novel-disguise loaded");
    // alert("started")
    // alert($.fn.jquery)

    const header_img = `data:image/png;base64,`;
    const body_img = `data:image/png;base64,`;
    const footer_img = `data:image/png;base64,`;
    const icon_img = `data:image/png;base64,`;

    const headerHeight = 159;
    const footerHeight = 22;
    const readerHeight = window.innerHeight - headerHeight - footerHeight;

    const link_text_color = "rgba(0,0,0,.7)";
    const link_bg_color = "#f6f6f6";
    const link_front_color = "rgba(0,0,0,.7)";

    const originalTitle = document.title;

    function common() {
        document.title = "文档1";

        //公共样式
        GM_addStyle(`
        .img-fill-in {
            background-repeat: no-repeat;
            background-size: 100% 100%;
        }
        
        html{
            overflow-y: hidden;
            color-scheme: normal !important;
        }
        
        #word-page {
            position: fixed;
            top: 0;
            left: 0;
            width: 100%;
            height: 100%;
            display: flex;
            flex-direction: column;
        }
        
        #word-header {
            height: ${headerHeight}px;
            width: 100%;
            background-image: url(${header_img});
        }
        
        #word-title {
            position: fixed;
            top: 5px;
            left: 0;
            width: 100%;
            z-index: 9999;
            text-align: center;
            color: #edffff;
            font-size: 12px;
            line-height: 22px;
        }
        
        #word-footer {
            height: ${footerHeight}px;
            line-height: ${footerHeight}px;
            width: 100%;
            background-image: url(${footer_img});
            font-size: 13px;
            color: #262626;
            padding-left: 20px;
            display: flex;
            flex-direction: row;
            flex-wrap: nowrap;
            align-content: center;
            justify-content: flex-start;
            align-items: center;
            box-sizing: border-box;
        }
        
        #word-footer > * {
            height: ${footerHeight}px;
            line-height: ${footerHeight}px;
            margin-right: 10px;
            font-size: 13px;
        }
        
        #word-body {
            flex: 1;
            padding-left: 25%;
            padding-right: 25%;
            background-image: url(${body_img}) !important;
            background-repeat: repeat-y;
            background-size: 100% auto;
            overflow-y: scroll;
            width: 100%;
            box-sizing: border-box;
        }
        
        #word-content {
            background-color: #FFF;
            border-left-color: #c6c6c6;
            border-right-color: #c6c6c6;
            border-left-width: 1px;
            border-right-width: 1px;
            min-height: 100%;
            width: 100%;
            padding-bottom: 10px;
        }
        
        #word-content p {
            color: black;
        }
        
        #word-content div {
            background-color: #FFF !important;
        }
        
        #word-right-content {
            display: none;
            position: fixed;
            right: 0;
            top: ${headerHeight}px;
            height: ${readerHeight}px;
            width: 400px;
        }
        
        
        `);

        // 图标
        var link = $('<link rel="icon" type="image/x-icon">').attr('href', icon_img);
        $('link[type="image/x-icon"]').remove();
        $('head').append(link);

        $('body').children().hide();

        $(`<div id='word-page'>
                <div id='word-title'></div>
                <div id='word-header' class='img-fill-in'></div>
                <div id='word-body'>
                    <div id='word-content'></div> 
                    <div id='word-right-content'></div>
                </div>
                <div id='word-footer' class='img-fill-in'><span>简体中文（中国大陆）</span><span>辅助功能：一切就绪</span></div>
               
           </div>`).appendTo("body");

    }

    function setWordContent($contentEl) {
        $contentEl.show().appendTo("#word-content");
    }

    function clearWordContent() {
        $('#word-content').empty();
    }

    function setWordTitle(titleStr) {
        $('#word-title').text(titleStr);
    }

    function setWordDetail(detail) {
        const $footerEl = $('#word-footer');
        $footerEl.text("");
        if (typeof detail === "string") {
            $footerEl.text(detailStr);
        } else {
            detail.appendTo($footerEl);
        }

    }

    function setWordRightContent($contentEl) {
        $contentEl.appendTo($("#word-right-content"));
    }


    /**
     * 起点
     */
    function qidian() {

        GM_addStyle(`
        #right-container {
            position: unset;
            height: 100%;
        }
        .chapter-end-qrcode {
          display: none;
        }
        .review-icon {
          background: var(--surface-gray-100) !important;
        }
        .review-count {
          color: var(--surface-gray-200) !important;
        }
        .tooltip-wrapper {
            display: none;
        }
        #side-sheet div, #side-sheet section {
            background-color: #FFF;
        }
        .chapter-date {
            background: unset !important;
        }
        button {
            background-color: ${link_bg_color} !important;
            color: ${link_text_color} !important;
        }
        button > span {
            color: ${link_text_color} !important;
        }
        #page-ops {
            // display: none !important;
        }
      
        `);

        //内容
        const scriptContent = $('#vite-plugin-ssr_pageContext').html();
        if (scriptContent && scriptContent.includes('"freeStatus":0')) {
            setWordContent($(".chapter-wrapper"));
            setTimeout(function () {
                clearWordContent();
                setWordContent($(".chapter-wrapper"));
                setWordRightContent($("#right-container"));
                observeComments();
                setInfo();
            }, 2000);
        } else {
            if (!$('main.content').hasClass('lock-mask')) {

                const targetNode = document.querySelector('main.content');
                const config = {childList: true};
                const callback = function (mutationsList, observer) {
                    for (let mutation of mutationsList) {
                        if (mutation.type === 'childList' && mutation.addedNodes.length > 0) {
                            setWordContent($(".chapter-wrapper"));
                            setWordRightContent($("#right-container"));
                            observeComments();
                            setInfo();
                            observer.disconnect();
                            break;
                        }
                    }
                };
                const observer = new MutationObserver(callback);
                observer.observe(targetNode, config);
            } else {
                setWordContent($(".chapter-wrapper"));
            }
        }
        setInfo();

        function observeComments() {
            //本章说
            const targetNode2 = document.querySelector('#side-sheet');
            const callback2 = function (mutationsList, observer) {
                for (let mutation of mutationsList) {
                    if (mutation.type === 'childList') {
                        if (mutation.addedNodes.length > 0) {
                            $("#word-right-content").show();
                        }
                        if (mutation.removedNodes.length > 0) {
                            $("#word-right-content").hide();
                        }
                    }
                }
            };
            const observer2 = new MutationObserver(callback2);
            observer2.observe(targetNode2, {childList: true});
        }

        function setInfo() {
            const titleEl = $('.chapter-wrapper h1.title');
            setWordTitle(titleEl.children().remove().end().text());
            titleEl.hide();

            const infoEl = titleEl.next();
            setWordDetail(infoEl.children());
            infoEl.hide();

            const downloadEl = $('#r-authorSay :contains("下载App")');
            downloadEl.hide();
        }


        setTimeout(function () {
            // 打赏按钮
            const admireBtnEl = $('._admireBtn_131ir_200');
            admireBtnEl.hide();

            $('body').attr('data-theme', 'beige');
        }, 2000);

    }

    /**
     * 番茄
     */
    function fanqie() {
        GM_addStyle(`
        .muye-reader-nav {
            display: none !important;
        }
        
        .byte-btn {
            background: ${link_bg_color} !important;
            color: ${link_front_color} !important;
        }
        
        .reader-toolbar {
            display: none;
        }
        
        .muye-reader-box {
            padding-top: 50px;
        }
        
        `);

        setWordContent($(".muye-reader-inner"));
        const titleEl = $('h1.muye-reader-title');
        setWordTitle(titleEl.text());
        titleEl.remove();

        const infoEl = $('.muye-reader-subtitle');
        setWordDetail(infoEl.children());
        infoEl.hide();
    }

    /**
     * 笔趣阁
     */
    function biquge_net() {

        GM_addStyle(`
        #read_tj {
            display: none;
        }
        
        .section-opt {
            border-top: none !important;
            border-bottom: none !important;
            color: ${link_text_color};
        }
        
        .section-opt a {
            color: ${link_text_color} !important;
        }
        
        .reader-main > a {
            display: none;
        }
        
        `);

        setWordContent($(".reader-main"));
        setWordTitle($(".title").text());
    }

    /**
     * 书香小说
     */
    function xbiqugu_net() {
        GM_addStyle(`
        .con_top, #listtj, #content_tip, .bookname>h1, #bdshare, #content>p {
            display: none;
        }
        
        .box_con {
            border: none;
        }
        
        .bookname {
            border-bottom: none;
            color: ${link_text_color};
        }
        
        .bottem2 {
            border-top: none;
            color: ${link_text_color};
        }
        
        .bottem1>a, .bottem2>a {
            color: ${link_text_color};
        }
        
        .box_con > table {
            display: none !important;
        }
        
        `);


        setWordContent($(".box_con"));
        setWordTitle($(".bookname h1").text());

    }

    /**
     * 笔趣阁
     * biquge.co
     */
    function biquge_co() {
        xbiqugu_net();
        GM_addStyle(`
        .lm {
            display: none;
        }
        `);
    }

    /**
     * 笔趣阁
     * www.52wx.com
     */
    function www_52wx_com() {
        GM_addStyle(`
        .hotcmd-box {
            display: none !important;
        }
        `);
        biquge_net();
    }

    /**
     * 笔趣阁
     * www.3bqg.cc
     */
    function www_3bqg_cc() {
        GM_addStyle(`
        #chaptercontent {
            border-top: none !important;
            border-bottom: none !important;
        }
        
        .content > h1, .content > .link, .readinline {
            display: none !important;
        }
        
        .Readpage a{
            color: ${link_text_color} !important;
            text-shadow: none !important;
        }
        `);
        setWordContent($(".content"));
        setWordTitle($(".content>h1").text());
    }

    /**
     * 笔趣阁
     * www.bigee.cc
     */
    function www_bigee_cc() {
        www_3bqg_cc();
    }

    /**
     * 笔趣阁
     * beqege.cc
     */
    function www_beqege_cc() {
        GM_addStyle(`
        .box_con {
            border: none !important;
        }
        
        .read-novel-link, #device, .con_top, .bookname>h1, #test1{
            display: none !important;
        }
        
        .bottem1, .bottem2 {
            border-top: none !important;
            border-bottom: none !important;
        }
        
        .bottem1 a, .bottem2 a {
            color: ${link_text_color} !important;
        }
        `);
        setWordContent($(".box_con"));
        setWordTitle($(".bookname>h1").text());
    }

    /**
     * 笔书网
     * biqukun.com
     */
    function www_biqukun_com() {
        www_beqege_cc();
        GM_addStyle(`
        .lm {
            display: none !important;
        }
        
        .bookname {
            border-bottom: none !important;
        }
        
        .box_con > table {
            display: none !important;
        }
        `);
    }

    /**
     * 笔趣阁
     * biquge.tw
     */
    function www_biquge_tw() {
        GM_addStyle(`
        #readSet, .book>h1, .chase-book-btn {
            display: none !important;
        }
        
        .read-page, .read-page a {
            border-top: none !important;
            border-bottom: none !important;
            border-left: none !important;
            border-right: none !important;
        }
        
        `);

        setWordTitle($(".book>h1").text());
        setWordContent($(".book"));
    }

    /**
     * 微信读书
     */
    function weread() {


        GM_addStyle(`
            .wr_canvasContainer {
                display: flex;
                flex-direction: column;
                justify-content: center;
                align-items: center;
            }
        
            .wr_canvasContainer canvas {
                display: block !important;
                position: unset !important;
            }
            
            .renderTarget_pager {
                display: flex;
                justify-content: space-evenly;
            }
            
            .renderTarget_pager_content {
                display: flex;
            }
            
            .renderTarget_pager_button {
                height: 32px;
                font-size: 13px;
                font-weight: 500;
                color: #b2b4b8;
                border-radius: 100px;
                border: 1px solid hsla(0, 0%, 100%, .1);
                cursor: pointer;
                z-index: 3;
                display: flex;
                flex-direction: row;
                justify-content: center;
                align-items: center;
                padding-left: 8px;
                padding-right: 12px;
            }
            
            .renderTarget_pager_button {
                color: #5d646e;
                border-color: rgba(0, 0, 0, .1);
            }
    
            .renderTarget_pager_button:hover {
                background-color: rgba(0, 0, 0, .03);
            }
            
            .renderTarget_pager_indicator:hover {
                background-color: rgba(0, 0, 0, .03);
            }

            .renderTarget_pager_indicator {
                color: #858c96;
                border-color: rgba(0, 0, 0, .1);
            }

            .renderTarget_pager_indicator {
                margin-left: 4px;
                margin-right: 4px;
                font-family: DIN-Medium, PingFang SC, -apple-system, SF UI Text, Lucida Grande, STheiti, Microsoft YaHei, sans-serif;
                font-weight: 500;
                text-align: center;
                font-size: 10px;
                line-height: 14px;
                border-radius: 9999px;
                padding: 3px 6px;
                color: #fff;
                z-index: 5;
                cursor: pointer;
                color: #8a8c90;
                border: 1px solid hsla(0, 0%, 100%, .1);
            }

        `);

        const targetNode = document.querySelector('.wr_canvasContainer');
        const callback = function (mutationsList, observer) {
            for (let mutation of mutationsList) {
                if (mutation.type === 'childList' && mutation.addedNodes.length > 0) {
                    common();
                    setWordTitle(originalTitle.replace(" - 微信读书", ""));
                    // setWordContent($(".renderTargetContainer"));
                    setWordContent($(".wr_canvasContainer"));
                    setWordContent($(".renderTarget_pager"));
                    setWordRightContent($(".top_reviews_panel"));
                    $(document).on('click', '.renderTarget_pager_indicator', function () {
                        $("#word-right-content").slideToggle();
                    });
                    observer.disconnect();
                    break;
                }
            }
        };
        const observer = new MutationObserver(callback);
        observer.observe(targetNode, {childList: true});

    }

    // main
    const currentHost = window.location.host;
    console.log('currentHost', currentHost);
    switch (currentHost) {
        case 'www.qidian.com':
            common();
            qidian();
            break;
        case 'fanqienovel.com':
            common();
            fanqie();
            break;
        case `www.biquge.net`:
            common();
            biquge_net();
            break;
        case 'www.xbiqugu.net':
            common();
            xbiqugu_net();
            break;
        case 'www.biquge.co':
            common();
            biquge_co();
            break;
        case 'www.52wx.com':
            common();
            www_52wx_com();
            break;
        case 'www.3bqg.cc':
            common();
            www_3bqg_cc();
            break;
        case 'www.bigee.cc':
            common();
            www_bigee_cc();
            break;
        case 'www.beqege.cc':
            common();
            www_beqege_cc();
            break;
        case 'www.biqukun.com':
            common();
            www_biqukun_com();
            break;
        case 'www.biquge.tw':
            common();
            www_biquge_tw();
            break;
        case 'weread.qq.com':
            weread();
            break;
    }
})();